import Head from "next/head";
import "global.scss";
import GoogleMaps from "GoogleMaps";

const Home = () => (
	<div className="container">
		<Head>
			<title>
				Коронавирус в Украине - создано искусственным интеллектом
			</title>
			<link rel="icon" href="coronavirus.png" />
		</Head>

		<main>
			<h1 className="title">
				Welcome to <a href="https://cov19.com">Next.js!</a>
			</h1>

			<p className="description">Get started by editing</p>

			<div className="grid">
				<GoogleMaps />
			</div>

			<section className="mainBlock"></section>
		</main>
		{/* <style jsx global>{``}</style> */}
	</div>
);

export default Home;
